import logo from "../assets/search.gif";
import styles from "./NavBar.module.css"
import style from "../App.module.css";

function NavBar() {
        return (
                <>
		<img className={styles.searchImage} src={logo} />
		<form className={style}>
		<div className={style.search}>
		<label htmlFor="search" className={style.searchword}></label>
		<input id="search" placeholder="search games" type="text" className={style.searchbar} />
		<button className={style.searchbutton}>Search <img className={styles.searchImage} src={logo} /></button>
		</div>
		</form>
                </>
        );
}

export default NavBar;
